export default class Body extends React.Component {

  render() {
    return (
      <div className="home d-flex col-md-12 align-items-center">
        <div className="banner-content">
                <h2>Unite your application<br />network with Starlify</h2>
                <div className="banner-button">
                    <button type="button" class="btn green-btn">Primary</button>
                    <button type="button" class="btn btn-primary">Primary</button>
                </div>
        </div>
      </div>
    )
  }
}
